import React, {useState, useEffect} from 'react';
import bugatti from '../images/bugatti.jpg'
import axios from 'axios';

const Dashboard = () => {
  const [mobil, setMobil] = useState([]);

useEffect(()=> {
  getMobil();
}, []);

const getMobil = async () => {
const response = await axios.get("http://localhost:5000/mobil");
  setMobil(response.data);
};

  return (
    <>
    {mobil.map((mobil, index)=> (
        <div class="card card-solid">
          <div class="card-body pb-0">
            <div class="row">
              <div class="col-sm-4"key ={mobil.id}>
                <div class="card bg-light d-flex flex-fill">

                  <div class="card-header border-bottom-0">
                    <h2 class="lead"><b>{mobil.nama}</b></h2>
                    <p class="text-muted text-sm"></p>
                  </div>

                  <div class="card-body pt-0">
                    <div class="row">

                      <div class="col-12 text-center">
                        <img class="img-thumbnail" src="" />
                      </div>
                    </div>
                  </div>

                  <div class="card-footer">
                    <div class="row">
                      <div class="col-sm-6">
                        <div class="text-start">
                          <p>{mobil.harga}</p>
                        </div>
                      </div>
                      <div class="col-sm-6">
                        <div class="text-right">
                          <a href="" class="btn btn-sm bg-teal">
                            <i class="fas fa-eye"></i>
                          </a>
                          <button type="submit" class="btn btn-sm btn-danger swalDefaultSuccess">
                            <i class="fas fa-shopping-cart"></i> Add To Cart
                          </button>
                        </div>
                      </div>
                    </div>
                  </div>

                </div>
              </div>
          </div>
        </div>
      </div>
    ))}
      </>
  )
}

export default Dashboard
